import React, { Component } from 'react';
import LeftSide from '../components/LeftSide'
import { Layout, Menu, Breadcrumb, Icon } from 'antd';
let Ske = ({children})=>{
  return (
    <Layout style={{minHeight:'100vh'}}>
      <LeftSide/>
      <div style={{padding:'20px'}}>
        {children}
      </div>
    </Layout>
  )
}

export default Ske
